        const GREEN_DURATION = 25;

        function getTrafficLightColor(lightId, time) {
            const phase = trafficLightsData[lightId]?.phase || 0;
            const cycleTime = (time + phase * 15) % LIGHT_CYCLE;

            if (cycleTime < GREEN_DURATION) {
                return [39, 174, 96, 255]; // Green
            } else if (cycleTime < GREEN_DURATION + 3) {
                return [241, 196, 15, 255]; // Yellow
            } else {
                return [231, 76, 60, 255]; // Red
            }
        }

        // Initialize deck.gl
        const deckgl = new DeckGL({
            container: 'container',
            mapStyle: 'https://basemaps.cartocdn.com/gl/dark-matter-nolabels-gl-style/style.json',
            initialViewState: {
                longitude: 3.4205,
                latitude: 6.4295,
                zoom: 15,
                pitch: 45,
                bearing: -15
            },
            controller: true,
            getTooltip: ({ object }) => object && object.lanes ? `Voies: ${object.lanes}` : null
        });

        function animate() {
            currentTime = (Date.now() / 1000 * ANIMATION_SPEED) % LOOP_LENGTH;

            // Create traffic light colors
            const lightColors = trafficLightsData.map((light, idx) => getTrafficLightColor(idx, currentTime));

            const layers = [
                // Road network - subtle glow on dark background
                new PathLayer({
                    id: 'roads',
                    data: pathsData,
                    getPath: d => d.path,
                    getWidth: d => d.width,
                    getColor: [80, 90, 100],
                    widthMinPixels: 3,
                    widthMaxPixels: 15,
                    capRounded: true,
                    jointRounded: true
                }),

                // Road center lines - subtle
                new PathLayer({
                    id: 'road-center',
                    data: pathsData,
                    getPath: d => d.path,
                    getWidth: 1,
                    getColor: [60, 70, 80],
                    widthMinPixels: 1,
                    getDashArray: [4, 4],
                    dashJustified: true
                }),

                // Traffic lights - 3D columns
                new ColumnLayer({
                    id: 'traffic-lights-pole',
                    data: trafficLightsData,
                    diskResolution: 8,
                    radius: 3,
                    extruded: true,
                    elevationScale: 1,
                    getPosition: d => d.position,
                    getFillColor: [40, 45, 55],
                    getElevation: 25,
                    pickable: false
                }),

                // Traffic light heads (colored) with glow effect
                new ScatterplotLayer({
                    id: 'traffic-lights-head',
                    data: trafficLightsData,
                    getPosition: d => [...d.position, 25],
                    getRadius: 10,
                    getFillColor: (d, { index }) => lightColors[index],
                    radiusMinPixels: 8,
                    radiusMaxPixels: 14,
                    pickable: false
                }),

                // Motos - bright orange trails (stand out on dark)
                new TripsLayer({
                    id: 'trips-motos',
                    data: tripsMotoData,
                    getPath: d => d.path,
                    getTimestamps: d => d.timestamps,
                    getColor: [253, 128, 93],
                    opacity: 0.9,
                    widthMinPixels: 3,
                    trailLength: 30,
                    currentTime: currentTime,
                    shadowEnabled: false
                }),

                // Cars - teal/cyan trails (complement orange on dark)
                new TripsLayer({
                    id: 'trips-cars',
                    data: tripsCarsData,
                    getPath: d => d.path,
                    getTimestamps: d => d.timestamps,
                    getColor: [23, 184, 190],
                    opacity: 0.95,
                    widthMinPixels: 5,
                    trailLength: 40,
                    currentTime: currentTime,
                    shadowEnabled: false
                })
            ];

            deckgl.setProps({ layers });
            requestAnimationFrame(animate);
        }

        // Start animation
        animate();
    </script>
</body>
</html>
